import ReactDOM from 'react-dom';
import React, { Component } from 'react';

const obj = [
	{
	  "Первые вопросы": [
		{
		  "name": "Папка 1",
		},
		{
		  "name": "Папка 2",
		  "additionFolders": [
			{
			  "name": "Подпапка 1",
			},
			{
			  "name": "Подпапка 2",
			},
		  ],
		},
		{
		  "name": "Папка 3",
		},
	  ]
	}
  ]

  class QuestionsArray extends Component {
	state = {
	  data: obj[0],
	}

	render() {
	  const { data } = this.state;
	  console.log(data.folders[1].additionFolders[0].name);

	  return (
		<div>
		  <ul>
			{data.folders.map((item, index) => (
			  <li key={index}>
				<span>{item.name}</span>
				{item.additionFolders ?
				  item.additionFolders.map((item_2, index_2) => (
					<ul key={index_2}>
					  <li>{item_2.name}</li>
					</ul>
				  )) : undefined
				}
			  </li>
			))} 
		  </ul>
		</div>
	  );
	}
  }

